import React, { Component } from "react";
import * as SurveyKo from "survey-knockout";
import * as SurveyJSCreator from "survey-creator";
import "survey-creator/survey-creator.css";

import "jquery-ui/themes/base/all.css";
import "nouislider/distribute/nouislider.css";
import "select2/dist/css/select2.css";
import "bootstrap-slider/dist/css/bootstrap-slider.css";

import "jquery-bar-rating/dist/themes/css-stars.css";
import "jquery-bar-rating/dist/themes/fontawesome-stars.css";

import $ from "jquery";
import "jquery-ui/ui/widgets/datepicker.js";
// import "select2/dist/js/select2.js";
// import "jquery-bar-rating";

//import "icheck/skins/square/blue.css";
import "pretty-checkbox/dist/pretty-checkbox.css";

import * as widgets from "surveyjs-widgets";
import { render } from "@testing-library/react";

SurveyJSCreator.StylesManager.applyTheme("default");

//widgets.icheck(SurveyKo, $);
widgets.prettycheckbox(SurveyKo);
widgets.select2(SurveyKo, $);
widgets.inputmask(SurveyKo);
widgets.jquerybarrating(SurveyKo, $);
widgets.jqueryuidatepicker(SurveyKo, $);
widgets.nouislider(SurveyKo);
widgets.select2tagbox(SurveyKo, $);
//widgets.signaturepad(SurveyKo);
widgets.sortablejs(SurveyKo);
widgets.ckeditor(SurveyKo);
widgets.autocomplete(SurveyKo, $);
widgets.bootstrapslider(SurveyKo);

class SurveyCreator extends Component {
    surveyCreator;

    componentDidMount(){
        let options = { showEmbededSurveyTab: true};
        this.surveyCreator = new SurveyJSCreator.SurveyCreator(
            null,
            options
        );
        // On save function
        this.surveyCreator.saveSurveyFunc = this.saveMySurvey;
        this.surveyCreator.tabs().push({
            name: "SSSF-Survey-Template",
            title: "SSSF Custom Survey",
            template: "custom-tab-survey-templates",
            actions: () => {
                this.surveyCreator.makeNewViewActive("SSSF-Survey-Template")
            },
            data: {}
        });
        this.surveyCreator.render("surveyCreatorContainer");
    }


    saveMySurvey = () => {
        console.log("Creator", this.surveyCreator);
        console.log("Completed Survey", this.surveyCreator.text);
    }

    render() {
        return (
            <>
                <script>
                    {`<div id="test">TEST</div>`}
                </script>
                <div id="surveyCreatorContainer"/>
            </>
        );
    }
}

export default SurveyCreator;
